const product_reducer = (state = {
    amount: 100
}, action) => {
    if (action.type == "") {
        return state
    }
    else if (action.type == "") {
        return state
    }
    else if (action.type == "") {
        return state
    }
    else if (action.type == "") {
        return state
    }
    else {
        return state
    }
}

export default product_reducer
